Photo by @FransLanting Tomorrow is World Photography Day. I invite you to join me for a free virtual event on August 19 at 7:00 pm Pacific Time, connected with our INTO AFRICA exhibition which is currently on display at the David Brower Center in Berkeley, California. If you live in the Bay area, you can get tickets to attend the event in person through the Events page on the Brower Center's website. But anyone in the world can join the livestream if you sign up for a free ticket by going to the link in my bio.

The event is called “The Art of Activism: Frans Lanting Award Ceremony.” I will be honored to receive the Brower Center’s Art/Act Award, given to artists who have dedicated their careers to using art for activism. Chris Eckstrom and I will have a live talk with renowned conservationist Kris Tompkins about our work in Africa and we will be joined later onstage and virtually by conservationists from the Wildlife Conservation Network and the Earth Island Institute. Follow us @FransLanting and @ChristineEckstrom for more stories from Africa and beyond.

