Photo by @FransLanting A full grown lion in his prime is a glorious sight, but not many of them make it to this stage. They run into trouble with rivals—or with people. A black-maned Kalahari lion like this one will not survive long with trophy hunters around.

I share this post in recognition of World Lion Day and the organizations working hard to guarantee a future for lions. Experts estimate that there are fewer than 20,000 lions left in the wild. Please support the organizations that are making a difference, including the Wildlife Conservation Network and its Lion Recovery Fund, and the World Wildlife Fund. Follow us @FransLanting and @ChristineEckstrom for more stories from the front lines of a changing planet.

